     &         UCha(Cha(4),2)*USf(Sfe6,1,3,Gen(1))))/(S2B*SB2)

        Sub3010(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6,Sfe7) = 
     &   -(1/2.D0*(Sub3009(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6)*
     &         USf(Sfe6,1,3,Gen(2))*USf(Sfe7,2,4,Gen(1)))) + 
     &    Sub2464(Gen(2),Sfe6)*
     &     Sub3008(HelAll(Cha(4)),Gen(1),Gen(2),Neu(3),Sfe6)*
     &     USf(Sfe7,1,4,Gen(1))

        ENDLOOP(Sfe6)
        ENDLOOP(Sfe7)

